-- Triggers structure for table "SDPROJECT"."STORYCOMMENTS"
-- ----------------------------
CREATE OR REPLACE TRIGGER "SDPROJECT"."COMMENTCOUNT_UPDATE" AFTER INSERT ON "SDPROJECT"."STORYCOMMENTS" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
BEGIN

    UPDATE STORY
    SET STORY.COMMENTCOUNT = STORY.COMMENTCOUNT+1
    WHERE STORYID = :NEW.SCOMMENTEDON ;

  END ;
;

